import React,{useState} from "react";

export const Camp = () =>{
    const [show,setShow] = useState(false);
    if(!show){
        return(   
            <section>
                <div class="container">
            
                    <h1 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(true)}>Лагерь</h1>
            
                </div>
            </section>
            )
    }else{
        return(   
            <section >
                <div class="container" style='border:1px red'>
            
                    <h1 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(false)}>Лагерь</h1>
                    <div>
                        Camp:
                    </div>
                </div>
            </section>
            )
    }
    
}
